    // Bool datatype store true/false as value

    // uint8 ,uint16, uint32,.....uint256 
    // This uint is nothing but integer according to numbers size like 8bit,16bit,32bit,....256bit

    uint8 public  num = 234;
    uint256 public Seconds_1day= 1 days;




}

